import React from 'react'
import {Route,useNavigate as navigate} from 'react-router-dom'

function ProtectedRoutes({isAuth: isAuth ,component:Component, ...rest}) {
  return (
    <div>
        <Route
        {...rest} 
        render={(props) => {
        if(isAuth){
            return <Component />
        }
        else{
            return <navigate to={{
                pathname: '/',
                state: { from: props.location }
            }} />
        }}}/>
    </div>
  )
}

export default ProtectedRoutes
